<script>
import BlogAuthor from '@/components/blog/BlogAuthor'

const colors = {
  "dev": "purple",
  "nodes": "yellow",
  "announcement": "green",
  "blockchain": "peach",
  "community": "turquoise",
  "cosmos": "pink",
  "design": "red",
  "governance": "orange",
  "introduction": "blue",
  "privacy": "purple",
  "secret apps": "green",
  "solutions": "green",
  "": "blue"
}

export default {
  components: { BlogAuthor },
  props: {
    tag: {
      type: String,
      required: false,
      default: ''
    }
  },
  data() {
    return {
      color: ''
    }
  },
  created() {
    this.color = this.getColor()
  },
  methods: {
    getColor() {
      return colors[this.tag.toLowerCase()]
    }
  }
}
</script>

